export const encodeUser = (_u: User): Result<string, unknown> => ({
  _tag: 'left',
  error: 'the lib cannot do it',
});

// utils

const mapResult = <T>(r: LibResult<T>): Result<string, T> =>
  r.success
    ? { _tag: 'right', value: r.value }
    : { _tag: 'left', error: r.message /*todo code, details*/ };
